import React from 'react';
import './Navbar.scss'
import uniswapLogo from '../images/logo_uniswap.png';

const Navbar = () => {
  return (
   <nav className="navbar">
    <div className="navbar__container">
      <a className="navbar__container__link" href="/">
        <img className='navbar__container__link__img' src={uniswapLogo} alt="logo" />
        <span className='navbar__container__link__text'>Common</span>
      </a>
    </div>
  </nav>
  )
}

export default Navbar
